import React from 'react';

import {MainPage} from './components/MainPage.js';
import './App.css';

function App() {
  window.location.href = "";
  return (
    <div className="App">
      <header className="App-header">
        <MainPage/>
      </header>
    </div>
  );
}

export default App;
